import React from 'react';
import { Link } from 'react-router-dom';

const Home = ({ shows }) => {
  return (
    <div>
      <h1>TV Shows</h1>
      {
        shows.map((show) => {
            return (
                <div key={show.show.id}>
                    <Link to={`/details/${show.show.id}`}>
                      <img src={show?.show?.image?.medium} alt="imageOfShow" />
                      <p>{show?.show?.name}</p>
                    </Link>
                </div>
            )
        })
      }
    </div>
  );
};

export default Home;
